const resolveId = (opts, label) => {
  if (!label) return undefined;
  if (opts[label]) return opts[label];
  const k = Object.keys(opts).find(x => x.toLowerCase() === String(label).toLowerCase());
  return k ? opts[k] : undefined;
};
