// === Order (7 champs garantis) ===
const orderedKeys = [
  'detailed_concept_description',
  'main_concept',
  'product_presented',
  'skin_tones',
  'ethnicity',
  'age_range',
  'gender',
];

// === Build values (alpha-proof) ===
const values = orderedKeys.map((key) => {
  const m = FIELDS[key];
  const raw = extracted[key];

  if (m.type === 'text') {
    const v = isNAish(raw) ? 'NA' : String(raw);
    return { field_definition_id: m.field_definition_id, value: v };
  }

  if (m.type === 'select') {
    const label = isNAish(raw) ? 'NA' : String(raw);
    const id = resolveId(m.options, label) || m.options['NA'];
    return { field_definition_id: m.field_definition_id, value: [id] }; // <- ARRAY obligatoire
  }

  if (m.type === 'select_multi') {
    let labels;
    if (isNAish(raw)) {
      labels = ['NA'];
    } else {
      labels = toArray(raw);
      if (!labels.length) labels = ['NA'];
    }
    const ids = Array.from(new Set(
      labels.map(l => resolveId(m.options, l) || (lower(l) === 'na' ? m.options['NA'] : undefined))
           .filter(Boolean)
    ));
    return { field_definition_id: m.field_definition_id, value: ids.length ? ids : [m.options['NA']] };
  }

  // Fallback ultra-sécurisé
  return { field_definition_id: m.field_definition_id, value: ['NA'] };
});

// (optionnel) petite assertion pour éviter d’envoyer un payload incomplet
if (values.length !== 7) {
  throw new Error(`Frame.io payload guard: expected 7 values, got ${values.length}`);
}

return [{
  json: {
    data: {
      file_ids: [assetId],
      values
    }
  }
}];
